function App() {
    return (
       <>
          <Router>
      <Switch>
      <Route path='/login' element={<Login/>} />
      <Route path='/register' element={<RegisterForm/>} />
      <Route path='/home' element={<Content/>} />
      </Switch>
    </Router>
       </>
      
       
    );
  }
  export default App;
